import React from 'react';
import '../App.css';
import { Container,Button } from "react-bootstrap";
import logo from '../assets/image/logo.png';

export default function Welcome(){
    return(
<div  >
    <Container className="main">
      
    <img src={logo} style={{height:200,width:200,paddingTop:90,paddingLeft:580,}}/>
    <h1 style={{fontSize:50,color:"#fff",paddingLeft:450,fontFamily:'Sonsie One'}}>WELCOME TO</h1>
    <h4 style={{fontSize:40,color:"#fff",paddingLeft:510,marginTop:-20,fontFamily:'Carter One'}}>DIGITAL IMMUNITY</h4>
    <h6 style={{fontSize:30,color:"#fff",paddingLeft:600,marginTop:-30,fontFamily:'Carter One',letterSpacing:3}}>PASSPORT</h6>
    <Button className="outline-primary">Primary</Button>{' '}
    </Container>
</div>

    )
}
